  `funding_approval_status` varchar(20) NOT NULL,
  `amount` varchar(20) DEFAULT NULL,
  `date_recorded` date NOT NULL,
  `comments` varchar(300) DEFAULT NULL,
  `created_by` varchar(45) DEFAULT NULL,
  `created_date` date DEFAULT NULL,
  `modified_by` varchar(45) DEFAULT NULL,
  `modified_date` date DEFAULT NULL,
  PRIMARY KEY (`job_id`),
  KEY `grant_approver_id` (`grant_approver_id`),
  CONSTRAINT `funding_confirmation_ibfk_1` FOREIGN KEY (`job_id`) REFERENCES `job` (`job_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `funding_confirmation_ibfk_2` FOREIGN KEY (`grant_approver_id`) REFERENCES `grant_approver` (`grant_approver_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
