  `species_id` int(11) DEFAULT NULL,
  `comments` varchar(45) DEFAULT NULL,
  `created_by` varchar(45) DEFAULT NULL,
  `created_date` date DEFAULT NULL,
  `modified_by` varchar(45) DEFAULT NULL,
  `modified_date` date DEFAULT NULL,
  PRIMARY KEY (`microarray_id`),
  KEY `fk_microarray_species` (`species_id`),
  KEY `fk_microarray_lab_user` (`lab_id`,`user_id`),
  CONSTRAINT `fk_microarray_lab_user` FOREIGN KEY (`lab_id`, `user_id`) REFERENCES `lab_user` (`lab_id`, `user_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_microarray_species` FOREIGN KEY (`species_id`) REFERENCES `species` (`species_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
