INSERT INTO `pilot_project` VALUES (1,'THI IS A TEST Project 1',5,1270758773,'Center for AIDS Research','Institute for Clinical And Translational Research',NULL,NULL,'Yes','TEST#1 (by Robert Dubin) on production server. This study is translational in that it focuses on epigenetic factors (methylation) that stimulate the progression from HIV infection to AIDS.  It is expected that such studies will result in the identification of molecular targets that may serve as potential candidates for future drug development with the potential to slow the progression to full-blown AIDS. (FYI: Centers selected were Center for AIDS Research and ICTR. Research Area selected was epigenomics of infectious disease.) Files were named test.txt and test word document.docx; grant number was GM-test-33A2345. Dubin was administrative assistant. ','Epigenomics of infectious diseases',NULL,'Rob Dubin','rdubin@aecom.yu.edu','718-678-1184','GM-test-333A2345',NULL,NULL,'1270758773_TestPI_description_test_word_document.docx','/data2/uploads/epigenomics_pilot_program/1270758773_TestPI_description_test_word_document.docx','1270758773_TestPI_funding_test.txt','/data2/uploads/epigenomics_pilot_program/1270758773_TestPI_funding_test.txt','2010-04-08',0,10,'ACCEPTED','2010-06-07','TestPI TestPI','2010-04-08','testpi','2010-04-21'),(4,'Transition state analogues & epigenetic changes in human cancer',102,1271779454,'Cancer Center','Institute for Clinical And Translational Research',NULL,NULL,'Yes','Cellular proliferation is regulated by specific gene regulation patterns responding to extracellular and metabolic signals. Epigenetic control via S-adenosylmethionine (AdoMet) modification of CpG sites is a validated target for cancer therapy. We investigated the possibility that inhibition of methylthioadenosine phosphorylase (MTAP) causes methylthioadenosine (MTA) accumulation altered AdoMet and changed patterns in CpG methylation and mRNA expression to initiate anticancer effects. Transition state analogue of MTAP causes change in MTA and AdoMet levels and in cancer cell growth in the context of mouse xenografts. A goal for this work is to coordinate altered methylation at CpG islands with specific mRNA expression in the four major human cancers in response to MTAP inhibition/MTA accumulation. MTDIA is an orally available, non-toxic (in mice), once-a-day therapy with promise for leading cancers with defined CpG island methylation and/or mRNA expression patterns. We project a future of this translational research when biopsy samples can be tested with small, selected CpG island methylation or mRNA arrays and the predicted responders can be treated with this novel, specific and non-toxic oral drug protocol.','Cancer epigenomics',NULL,'Leslie Jefferson','ljeffer@aecom.yu.edu','(718) 430-2814','95263587',NULL,NULL,'1271779454_VSchramm_description_Basu-SchrammMTAP_PilotProject19April10.doc','/data2/uploads/epigenomics_pilot_program/1271779454_VSchramm_description_Basu-SchrammMTAP_PilotProject19April10.doc','1271779454_VSchramm_funding_Basu-SchrammMTAP_ExternalFunding19April10.doc','/data2/uploads/epigenomics_pilot_program/1271779454_VSchramm_funding_Basu-SchrammMTAP_ExternalFunding19April10.doc','2010-04-20',0,10,'ACCEPTED','2010-06-10','Vern Schramm','2010-04-20','JGreally','2010-06-10'),(5,'This is a test by R. Dubin.  Just a test, as we updated some pointers',5,1272293254,'Cancer Center',NULL,NULL,NULL,'Yes','Again, just a test by R. Dubin, to re-confirm that all is OK after some pointer updates ','Cancer epigenomics',NULL,'Rob Dubin','rdubin@aecom.yu.edu','718 678-1184','test_grant_number',NULL,NULL,'1272293254_TestPI_description_pcr_test.txt','/data2/uploads/epigenomics_pilot_program/1272293254_TestPI_description_pcr_test.txt','1272293254_TestPI_funding_gel_test.txt','/data2/uploads/epigenomics_pilot_program/1272293254_TestPI_funding_gel_test.txt','2010-04-26',0,10,NULL,NULL,'TestPI TestPI','2010-04-26','TestPI TestPI','2010-04-26'),(6,'miRNA analysis in human neurons derived from patient-specific (schizophrenia) iPSC lines',113,1272298436,NULL,NULL,NULL,NULL,'Yes','We are carrying out molecular studies on human neurons derived from patients with schizophrenia and controls. These will provide insight into fundamental molecular mechanisms of disease that could be used for new drug development.','Other','miRNA expression','Margie O\\\'Connor','Marguerite.OConnor@einstein.yu.edu','430-3080','3782',NULL,NULL,'1272298436_HLachman_description_pilot_project_description.doc','/data2/uploads/epigenomics_pilot_program/1272298436_HLachman_description_pilot_project_description.doc','1272298436_HLachman_funding_future_external_funding.doc','/data2/uploads/epigenomics_pilot_program/1272298436_HLachman_funding_future_external_funding.doc','2010-04-26',0,10,'ACCEPTED','2010-06-10','Herb Lachman','2010-04-26','JGreally','2010-06-10'),(7,'CSF-1R-regulation of miRNA expression in macrophages',66,1272478937,'Cancer Center','Diabetes Center',NULL,NULL,'Yes','CSF-1 regulation by macrophages plays a central role in the progression of inflammatory disease and cancer. Inhibitors of CSF-1 and its receptor from several Pharmaceutical companies are currently in Phase 1/2 trials.','Biochemical epigenomics',NULL,'Mary Cappelo','mary.cappello@einstein.yu.edu','(718)-430-2095','3889',NULL,NULL,'1272478937_EStanley_description_Stanley_ER_Pilot_Project_Description.doc','/data2/uploads/epigenomics_pilot_program/1272478937_EStanley_description_Stanley_ER_Pilot_Project_Description.doc','1272478937_EStanley_funding_Stanley_ER_Future_External_Funding.doc','/data2/uploads/epigenomics_pilot_program/1272478937_EStanley_funding_Stanley_ER_Future_External_Funding.doc','2010-04-28',0,10,'ACCEPTED','2010-06-10','E. RIchard Stanley','2010-04-28','JGreally','2010-06-10'),(8,'Genome-wide Binding of Individual H1 Linker Histone Subtypes',38,1272562908,'Cancer Center',NULL,NULL,NULL,'No',NULL,'Stem cell epigenomics',NULL,'Danielle Crane','<danielle.crane@einstein.yu.edu','718-430-2815','9526-9527',NULL,NULL,'1272562908_ASkoultchi_description_Pilot_Project_Description.docx','/data2/uploads/epigenomics_pilot_program/1272562908_ASkoultchi_description_Pilot_Project_Description.docx','1272562908_ASkoultchi_funding_Future_External_Funding_Application_Description.docx','/data2/uploads/epigenomics_pilot_program/1272562908_ASkoultchi_funding_Future_External_Funding_Application_Description.docx','2010-04-29',0,10,'ACCEPTED','2010-06-10','Arthur Skoultchi','2010-04-29','JGreally','2010-06-10'),(9,'Molecular profiling of multifunctional memory CD8 T cells in Listeria-infected mice',106,1272565769,NULL,NULL,NULL,NULL,'No',NULL,'Epigenomic reprogramming',NULL,'Susan Nuccio','susan.nuccio@einstein.yu.edu','718 430 2664','95269511',NULL,NULL,'1272565769_GLauvau_description_Pilot_Project_description___Lauvau.pdf','/data2/uploads/epigenomics_pilot_program/1272565769_GLauvau_description_Pilot_Project_description___Lauvau.pdf','1272565769_GLauvau_funding_External_funding_application_description___Lauvau.pdf','/data2/uploads/epigenomics_pilot_program/1272565769_GLauvau_funding_External_funding_application_description___Lauvau.pdf','2010-04-29',0,10,'REJECTED','2010-06-10','Gregoire Lauvau','2010-04-29','JGreally','2010-06-10'),(10,'The role of Lid in the recognition and removal of methylated histone H3K4',24,1272637452,'Cancer Center',NULL,NULL,NULL,'No',NULL,'Developmental epigenomics',NULL,'Karen Roman','karen.roman@einstein.yu.edu','718-430-2824','9-526 -9517-431 ',NULL,NULL,'1272637452_JSecombe_description_pilot_project_description.pdf','/data2/uploads/epigenomics_pilot_program/1272637452_JSecombe_description_pilot_project_description.pdf','1272637452_JSecombe_funding_Future_external_funding.pdf','/data2/uploads/epigenomics_pilot_program/1272637452_JSecombe_funding_Future_external_funding.pdf','2010-04-30',0,10,'ACCEPTED','2010-06-10','Julie Secombe','2010-04-30','JGreally','2010-06-10'),(11,'Molecular mechanism of lens fiber cell denucleation (karyolysis)',53,1272642603,NULL,NULL,NULL,NULL,'No',NULL,'Developmental epigenomics',NULL,'Jennifer Wu','jennifer.wu@einstein.yu.edu','718-430-3697','9-526-3909','9-526-4008',NULL,'1272642603_ACvekl_description_Epigenet_lens_pilot_042910.doc','/data2/uploads/epigenomics_pilot_program/1272642603_ACvekl_description_Epigenet_lens_pilot_042910.doc','1272642603_ACvekl_funding_Epigenet_lens_042910.doc','/data2/uploads/epigenomics_pilot_program/1272642603_ACvekl_funding_Epigenet_lens_042910.doc','2010-04-30',0,10,'ACCEPTED','2010-06-10','Ales Cvekl','2010-04-30','JGreally','2010-06-10'),(12,'EPIGENOMIC ANALYSIS OF INTESTINAL TISSUES IN PEDIATRIC INFLAMMATORY BOWEL DISEASE',107,1272646077,NULL,NULL,NULL,NULL,'Yes','This study aims to identify genetic-epigenetic interactions in\r\nintestinal tissues from Inflammatory Bowel Disease patients (IBD). These data will then be used to\r\ndesign novel therapeutic interventions. Thus, our study is a classical\r\ntranslational study whereby the goal of our analysis of patients\\\'\r\ntissues is to translate it into new therapies.\r\n ','Epigenomics of gastrointestinal disorders',NULL,'Sarah Grainger','sarah.grainger@einstein.yu.edu','(718) 430-2077','9526-0978',NULL,NULL,'1272646077_GTomer_description_Gitit_Tomer_Epigenetics_application__Final.doc','/data2/uploads/epigenomics_pilot_program/1272646077_GTomer_description_Gitit_Tomer_Epigenetics_application__Final.doc','1272646077_GTomer_funding_Gitit_Tomer_Epigenetics_CCFA_Grant_Specific_Aims.doc','/data2/uploads/epigenomics_pilot_program/1272646077_GTomer_funding_Gitit_Tomer_Epigenetics_CCFA_Grant_Specific_Aims.doc','2010-04-30',0,10,'REJECTED','2010-06-10','Gitit Tomer','2010-04-30','JGreally','2010-06-10'),(13,'ChIP-seq analysis of condensin chromosome-occupancy over a complete mitosis ',101,1272663293,'Cancer Center',NULL,NULL,NULL,'No','Each time a cell divides it must accurately distribute one copy of each duplicated chromosome to each daughter. To accomplish this the replicated sister chromatids are paired, aligned, glued-together, resolved, condensed, and finally pulled to opposite sides of the cell. A defect at any of these steps can lead to aneuploidy, a condition of inappropriate chromosome number often associated with birth defects and cancer. We are investigating how chromosome condensation, an obligate step in mitosis, is controlled at the molecular level.','Model organism epigenomics',NULL,'Danielle Crane','danielle.crane@einstein.yu.edu','(718) 430-2815','Internal Funding','(NSF + NIH R01 Pending)',NULL,'1272663293_MKeogh_description_RFA2010___Pilot_Description__KEOGH_.docx','/data2/uploads/epigenomics_pilot_program/1272663293_MKeogh_description_RFA2010___Pilot_Description__KEOGH_.docx','1272663293_MKeogh_funding_RFA2010___External_Funding_Aims__KEOGH_.docx','/data2/uploads/epigenomics_pilot_program/1272663293_MKeogh_funding_RFA2010___External_Funding_Aims__KEOGH_.docx','2010-04-30',0,10,'ACCEPTED','2010-06-10','Michae-Christopher Keogh','2010-04-30','JGreally','2010-06-10'),(14,'Epigenomic Analysis of Cleft Lip and Palate as Influenced by Environmental Exposure',118,1272671515,NULL,NULL,NULL,NULL,'Yes','Orofacial clefting is the most common congenital facial defect, and is associated both genetic and environmental risk factors. Orofacial clefting includes cleft lip and palate (CL+P), isolated cleft lip (CL), and isolated cleft palate (CP). The incidence of orofacial clefting varies among different races and ethnic groups, with Hispanics having the highest prevalence of CL+P (6.2/10,000) and blacks having the lowest prevalence (3.7/10,000) of CL+P1. Our primary objectives in the current study are translational: 1) to determine the significance of the disparity in incidence rates of orofacial clefting among different racial/ethnic groups in the Bronx, and 2) to determine whether there is an association between exposure to teratogenic substances and CL+P in the Bronx, controlling for maternal and paternal age, gender, family history, gestation time, and parity. This pilot study will use electronic medical and dental record databases to identify patients with craniofacial syndromes, including CL+P, to establish cohorts for candidate gene assays, to search for SNPs, and to perform epigenomic studies to generate preliminary data that will be used to apply for external funding in the future. If environmental factors can be identified that are associated with orofacial clefting, early pre-natal interventions may be identified that could reduce risk and decrease incidence of this often tragically disfiguring and life threatening disease to improve human health.','Epigenomic dysregulation as a response to toxin or drug exposure',NULL,'Charles Brockett','cbrockett@montefiore.org','718-920-4167','NA',NULL,NULL,'1272671515_JKazimiroff_description_JK_Epigenomics_Page_1.doc','/data2/uploads/epigenomics_pilot_program/1272671515_JKazimiroff_description_JK_Epigenomics_Page_1.doc','1272671515_JKazimiroff_funding_.ending','/data2/uploads/epigenomics_pilot_program/1272671515_JKazimiroff_funding_.ending','2010-04-30',0,10,'REJECTED','2010-06-10','Julie Kazimiroff','2010-04-30','JGreally','2010-06-10'),(15,'Retinoic acid induces stem cell differentiation through an active demethylation switch',49,1272676169,NULL,NULL,NULL,NULL,'Yes','Epigenetic mechanisms are higly utilized to create stable cell-fate memories during differentiation of stem cells. Understanding the switch between stem cell proliferation to differention has outmost importance for the development of many therapatic strategies for different diseases.\r\n\r\n','Developmental epigenomics',NULL,'Karen Roman','karen.roman@einstein.yu.edu','2825','Start-up',NULL,NULL,'1272676169_EOzbudak_description_Epigenomics_Pilot_Project_description_Ozbudak.pdf','/data2/uploads/epigenomics_pilot_program/1272676169_EOzbudak_description_Epigenomics_Pilot_Project_description_Ozbudak.pdf','1272676169_EOzbudak_funding_Epigenomics_Future_external_funding_application_description_Ozbudak.pdf','/data2/uploads/epigenomics_pilot_program/1272676169_EOzbudak_funding_Epigenomics_Future_external_funding_application_description_Ozbudak.pdf','2010-04-30',0,10,'ACCEPTED','2010-06-10','Ertugrul Ozbudak','2010-04-30','JGreally','2010-06-10'),(16,'Exposure to a Maternal High Fat Diet Programs Obesity: Evaluation of CpG Methylation  ',120,1272688691,'Cancer Center','Diabetes Center',NULL,NULL,'Yes','Using a mouse model of maternal high fat (HF) diet throughout gestation and lactation, we have shown that (HF) offspring undergo accelerated weight gain early in life that correlates with development of metabolic syndrome.  Increased weight gain was largely due to increased adiposity and increased adipose cell size (100% increase in cell size by 5 wks of age which persisted throughout the study; 26 wks).  The incidence of childhood and adult obesity and other metabolic diseases (such as diabetes and the metabolic syndrome) has dramatically risen in recent years.  Epidemiology and laboratory studies indicate the obesity epidemic may have an epigenetic basis. The mouse model we are using behaves similar to a non-human primate model of the human condition (including similar molecular changes), therefore our studies are aimed at translating findings from the mouse to human adipose tissue biopsies that may be obtained in future collaborative studies with surgeons performing gastric bypass (etc) on young patients.  Hopefully, these studies will identify novel anti-obesity therapeutic targets that will improve human health.','Epigenomics of diabetes and other metabolic diseases',NULL,'Leslie Jefferson','Leslie Jefferson@einstein.yu.edu','(718)430-2814','9-526-0667','9-526-3235',NULL,'1272688691_MCharron_description_Pilot_Project_Description_Charron.doc','/data2/uploads/epigenomics_pilot_program/1272688691_MCharron_description_Pilot_Project_Description_Charron.doc','1272688691_MCharron_funding_Future_External_Funding_Charron.doc','/data2/uploads/epigenomics_pilot_program/1272688691_MCharron_funding_Future_External_Funding_Charron.doc','2010-05-01',0,10,'ACCEPTED','2010-06-10','Maureen Charron','2010-05-01','JGreally','2010-06-10'),(17,'Epigenomic analysis of ST-elevation myocardial infarction',114,1272691357,'Cancer Center',NULL,NULL,NULL,'Yes','This study employs samples from human subjects with cardiovascular disease, and may lead to improved tools for clinical diagnosis and prognosis.','Cardiovascular epigenomics',NULL,'Theresa Grosso','theresa.grosso@einstein.yu.edu','718 430-2465','NIH HL088104',NULL,NULL,'1272691357_NSibinga_description_Sibinga_epigenomics_pilot_p_1.pdf','/data2/uploads/epigenomics_pilot_program/1272691357_NSibinga_description_Sibinga_epigenomics_pilot_p_1.pdf','1272691357_NSibinga_funding_Sibinga_epigenomics_future_p_2.pdf','/data2/uploads/epigenomics_pilot_program/1272691357_NSibinga_funding_Sibinga_epigenomics_future_p_2.pdf','2010-05-01',0,10,'ACCEPTED','2010-06-10','Nicholas Sibinga','2010-05-01','JGreally','2010-06-10'),(18,'Epigenomic Analysis of Cleft Lip and Palate as Influenced by Environmental Exposure',118,1272730683,NULL,NULL,NULL,NULL,'Yes','Orofacial clefting is the most common congenital facial defect, and is associated both genetic and environmental risk factors. Orofacial clefting includes cleft lip and palate (CL+P), isolated cleft lip (CL), and isolated cleft palate (CP). The incidence of orofacial clefting varies among different races and ethnic groups, with Hispanics having the highest prevalence of CL+P (6.2/10,000) and blacks having the lowest prevalence (3.7/10,000) of CL+P1. Our primary objectives in the current study are translational: 1) to determine the significance of the disparity in incidence rates of orofacial clefting among different racial/ethnic groups in the Bronx, and 2) to determine whether there is an association between exposure to teratogenic substances and CL+P in the Bronx, controlling for maternal and paternal age, gender, family history, gestation time, and parity. This pilot study will use electronic medical and dental rec!\r\n ord databases to identify patients with craniofacial syndromes, including CL+P, to establish cohorts for candidate gene assays, to search for SNPs, and to perform epigenomic studies to generate preliminary data that will be used to apply for external funding in the future. If environmental factors can be identified that are associated with orofacial clefting, early pre-natal interventions may be identified that could reduce risk and decrease incidence of this often tragically disfiguring and life threatening disease to improve human health.\r\n\r\n','Epigenomic dysregulation as a response to toxin or drug exposure',NULL,'Charles Brockett','cbrockett@montefiore.org','718-920-6035','NA',NULL,NULL,'1272730683_JKazimiroff_description_Genetic_and_Epigenomic_Analysis_of_Cleft_Lip_and_Palate.doc','/data2/uploads/epigenomics_pilot_program/1272730683_JKazimiroff_description_Genetic_and_Epigenomic_Analysis_of_Cleft_Lip_and_Palate.doc','1272730683_JKazimiroff_funding_Epidemiology_Study_of_Orofacial_Clefting_and_the_Bronx.doc','/data2/uploads/epigenomics_pilot_program/1272730683_JKazimiroff_funding_Epidemiology_Study_of_Orofacial_Clefting_and_the_Bronx.doc','2010-05-01',0,10,'REJECTED','2010-06-10','Julie Kazimiroff','2010-05-01','JGreally','2010-06-10'),(19,'Predicting response to therapy among patients with Hodgkin Disease',105,1272740919,'Cancer Center','Institute for Clinical And Translational Research',NULL,NULL,'Yes','We will use patient-derived nodes to contrast DNA methylation in patients with favorable and unfavorable responses to chemotherapy treatment for Hodgkin Disease.','Cancer epigenomics',NULL,'Sarah Grainger','Sarah.Grainger@Einstein.YU.edu','718-430-2077','9526-9460',NULL,NULL,'1272740919_PCole_description_Cole_Pilot_Proposal.pdf','/data2/uploads/epigenomics_pilot_program/1272740919_PCole_description_Cole_Pilot_Proposal.pdf','1272740919_PCole_funding_Cole_Future_Funding_Plans.pdf','/data2/uploads/epigenomics_pilot_program/1272740919_PCole_funding_Cole_Future_Funding_Plans.pdf','2010-05-01',0,10,'REJECTED','2010-06-10','Peter Cole','2010-05-01','JGreally','2010-06-10'),(20,'Identification of Novel microRNAs in Dendritic Cells',119,1272741354,'Center for AIDS Research',NULL,NULL,NULL,'Yes','Regulating activation of dendritic cells through pattern recognition receptors is critical for controlling diverse responses, including infections and autoimmune diseases. Our study seeks to identify novel miRNAs involved in DC activation, and elucidate the molecular mechanisms used by these miRNAs to regulate DC signaling.','Epigenomics of infectious diseases',NULL,'Susan Nuccio','susan.nuccio@einstein.yu.edu','430 2811','9526-9451',NULL,NULL,'1272741354_DPalliser_description_Palliser_PilotProject_05_01_2010.pdf','/data2/uploads/epigenomics_pilot_program/1272741354_DPalliser_description_Palliser_PilotProject_05_01_2010.pdf','1272741354_DPalliser_funding_Palliser_FutureFunding_05_01_2010.pdf','/data2/uploads/epigenomics_pilot_program/1272741354_DPalliser_funding_Palliser_FutureFunding_05_01_2010.pdf','2010-05-01',0,10,'ACCEPTED','2010-06-10','Deborah Palliser','2010-05-01','JGreally','2010-06-10'),(21,'Nfact1 Transcriptional Network and Heart Development',18,1272769463,NULL,NULL,NULL,NULL,'Yes','The project should be considered as translational because it studies the mechanisms of cardiac and coronary vessel development, which is directly relevant to congenital heart disease and coronary vascular regeneration.','Cardiovascular epigenomics',NULL,'Karen Roman','kroman@aecom.yu.edu','718-430-2824','9-526-9479',NULL,NULL,'1272769463_BZhou_description_Bin_Zhou_Epigenetic_Pilot_part1.pdf','/data2/uploads/epigenomics_pilot_program/1272769463_BZhou_description_Bin_Zhou_Epigenetic_Pilot_part1.pdf','1272769463_BZhou_funding_Bin_Zhou_Epigenetic_Pilot_part2.pdf','/data2/uploads/epigenomics_pilot_program/1272769463_BZhou_funding_Bin_Zhou_Epigenetic_Pilot_part2.pdf','2010-05-01',0,10,'ACCEPTED','2010-06-10','Bin Zhou','2010-05-01','JGreally','2010-06-10'),(22,'Exploring the senescence-induced changes in macroH2A1 and PARP-1 genomic localization',91,1272769528,'Cancer Center',NULL,NULL,NULL,'No',NULL,'Cancer epigenomics',NULL,'Anna Cioffi','anna.cioffi@einstein.yu.edu','718-430-2330','95269518',NULL,NULL,'1272769528_MGamble_description_100501_epigenetics_pilot_project_Gamble.docx','/data2/uploads/epigenomics_pilot_program/1272769528_MGamble_description_100501_epigenetics_pilot_project_Gamble.docx','1272769528_MGamble_funding_100501_epigenetics_pilot_project2_Gamble.docx','/data2/uploads/epigenomics_pilot_program/1272769528_MGamble_funding_100501_epigenetics_pilot_project2_Gamble.docx','2010-05-01',0,10,'ACCEPTED','2010-06-10','Matthew Gamble','2010-05-01','JGreally','2010-06-10'),(23,'How Toxoplasma gondii Alters the Epigenome of Infected Human Cells.',85,1272770726,'Center for AIDS Research',NULL,NULL,NULL,'Yes','Toxoplasma gondii is a human parasitic infection that causes birth defects and opportunistic infections in immunocompromised individuals, including people with AIDS. Before antiretrovirals, toxoplasmosis was a common AIDS defining opportunistic infection, and it is still seen as a presenting AIDS diagnosis for individuals unaware of their HIV status. Toxoplasma gondii is also a model organism for other clinically important Apicomplexa, including Plasmodium, the causative agent of malaria. Our project seeks to define how Toxoplasma affects the epigenetic processes in host cells, an important aspect of host-pathogen interaction that has not been explored in prior studies to understand pathogenesis of infectious diseases.','Epigenomics of infectious diseases',NULL,'Jo Luccioni','josephine.luccioni@einstein.yu.edu','718 430 2215','1R01AI087625-01A1',NULL,NULL,'1272770726_KKim_description_EpigenomePilot1.doc','/data2/uploads/epigenomics_pilot_program/1272770726_KKim_description_EpigenomePilot1.doc','1272770726_KKim_funding_EpigenomePilot2.doc','/data2/uploads/epigenomics_pilot_program/1272770726_KKim_funding_EpigenomePilot2.doc','2010-05-01',0,10,'ACCEPTED','2010-06-10','Kami Kim','2010-05-01','JGreally','2010-06-10');
